// Generated by BUCKLESCRIPT, PLEASE EDIT WITH CARE
'use strict';

var React = require("react");
var DomUtils = require("../shared/utils/DomUtils.bs.js");
var ReactDOMRe = require("reason-react/src/ReactDOMRe.js");
var Json_decode = require("@glennsl/bs-json/src/Json_decode.bs.js");
var CoursesReport__Root = require("../courses/report/components/CoursesReport__Root.bs.js");
var CoursesReport__Coach = require("../courses/report/types/CoursesReport__Coach.bs.js");
var CoursesReport__Level = require("../courses/report/types/CoursesReport__Level.bs.js");

function decodeProps(json) {
  return /* tuple */[
          Json_decode.field("studentId", Json_decode.string, json),
          Json_decode.field("levels", (function (param) {
                  return Json_decode.array(CoursesReport__Level.decode, param);
                }), json),
          Json_decode.field("coaches", (function (param) {
                  return Json_decode.array(CoursesReport__Coach.decode, param);
                }), json),
          Json_decode.field("teamStudentIds", (function (param) {
                  return Json_decode.array(Json_decode.string, param);
                }), json)
        ];
}

var match = decodeProps(DomUtils.parseJSONTag("course-student-report__props", /* () */0));

var teamStudentIds = match[3];

var coaches = match[2];

var levels = match[1];

var studentId = match[0];

ReactDOMRe.renderToElementWithId(React.createElement(CoursesReport__Root.make, {
          studentId: studentId,
          levels: levels,
          coaches: coaches,
          teamStudentIds: teamStudentIds
        }), "react-root");

exports.decodeProps = decodeProps;
exports.studentId = studentId;
exports.levels = levels;
exports.coaches = coaches;
exports.teamStudentIds = teamStudentIds;
